import React from "react";
import { Button, Grid, TextField, Stack, Container } from "@mui/material";
import "./index.css";

function Login() {
  return (
      <Grid sx={{ background: "yellow" }}
      container spacing={4}
      direction="column"
      justifyContent="center"
      alignItems="center">
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
         fullWidth
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained">
            Login
          </Button>
      </Grid>
  );
}

export default Login;
